ht.columns.drawCell:
__ht__function(g, text, rect, option) {
            var defaultDraw = option.defaultDraw,
                row = option.row,
                x = rect.x + 5,
                y = rect.y + 5,
                width = rect.width - 10,
                height = rect.height - 10,
                off = 6;
            if (row.sex === '女') {
                g.beginPath();
                g.moveTo(x + off, y);
                g.lineTo(x + width, y);
                g.lineTo(x + width, y + height - off);
                g.lineTo(x + width - off, y + height);
                g.lineTo(x, y + height);
                g.lineTo(x, y + off);
                g.closePath();
                g.fillStyle = 'rgba(51,153,255,0.3)';
                g.fill();
            }

            defaultDraw();
        }
